import React from 'react';
import '../styles/Navigation.css';
function Navigation() {
  return (
      <div className="navCont">
        <nav className="navigation">
            <ul className="list">
                <li className="list__item">Films</li>
                <li className="list__item">Slider</li>
                <li className="list__item">Map</li>
                <li className="list__item">ToDo List</li>
                <li className="list__item">bla bla bla</li>
            </ul>
        </nav>
      </div>
  );
}

export default Navigation;
